import "./App.css";
import Home from "./pages/Home";
import { Route, Routes } from "react-router-dom";
import UploadPost from "./pages/UploadPost";

function App() {
  return (
    <Routes>
      <div className="App">
        <Home />
      </div>
      <Route path="/" element={<Home />} />
      <Route path="/UploadPost" element={<UploadPost />} />
    </Routes>
  );
}

export default App;
